import React from "react";
import { Link } from "react-router-dom";

import { useForm, FieldValues } from "react-hook-form";

function Login() {
  const {
    register,
    handleSubmit,
    formState: { errors },
    reset,
  } = useForm();

  const onSubmit = (data: FieldValues) => {
    console.log(data);
    reset();
  };

  return (
    <>
      <div className="backDesign">
        <div className="d-flex align-items-center justify-content-center h-100">
          <div className="box">
            <h2 className="signHead">Login</h2>
            <form
              className="d-flex flex-column"
              onSubmit={handleSubmit(onSubmit)}
            >
              <input
                {...register("email", {
                  required: true,
                  pattern: {
                    value:
                      /^(([^<>()[\]\\.,;:\s@"]+(\.[^<>()[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/,
                    message: "please follow correct format for password",
                  },
                })}
                id="email"
                type="email"
                placeholder="Email"
                className="my-2"
                onError={errors.email?.message}
              />
              <p className="text-danger">{errors.email?.message?.toString()}</p>

              <input
                {...register("password", { required: "password" })}
                type="password"
                id="password"
                placeholder="Password"
                className="my-2"
              />
              {/* <Link to="/home" className="w-100"> */}
              <button className="signBtn w-100 my-2">Login</button>
              {/* </Link> */}
            </form>
          </div>
        </div>
      </div>
    </>
  );
}

export default Login;
